import React from 'react';
import styles from './App.module.scss';
import { routes } from '../shared/routes';
import { Routes , Route } from 'react-router-dom';

function App() {
  return (
    <div className={styles.app}>
      <div className={styles.border_right}></div>
      <div className={styles.border_top}></div>
      <div className={styles.border_bottom}></div>
      <div className={styles.border_left}></div>
      <svg width="300" height="300" data-name="corner-top-left" xmlns="http://www.w3.org/2000/svg" style="pointer-events:none" data-inlinesvg=".inlineSvgFile-7"><defs><linearGradient id="grad1" x1="0%" y1="0%" x2="100%" y2="100%"><stop offset="0" class="gradient1"></stop><stop offset=".5" class="gradient2"></stop><stop offset="1" class="gradient1"></stop></linearGradient></defs><path fill="url('#grad1')" d="M8 0h292l-20 20H25a5 5 0 0 0-5 5v255L0 300V8a8 8 0 0 1 8-8Z"></path></svg>
      <Routes>
        {routes?.map((route) => (
          <Route key={route.path} path={route.path} element={route.component} />
        ))}
      </Routes>
    </div>
  );
}

export default App;
